import { StyleSheet } from 'react-native';

export default StyleSheet.create({
  'App': {
    'textAlign': 'center'
  },
  'App-logo': {
    'height': [{ 'unit': 'px', 'value': 40 }],
    'pointerEvents': 'none',
    'prefers-reduced-motion no-preferenc': {
      'animation': 'App-logo-spin infinite 20s linear'
    }
  },
  'App-header': {
    'backgroundColor': '#282c34',
    'minHeight': [{ 'unit': 'vh', 'value': 100 }],
    'display': 'flex',
    'flexDirection': 'column',
    'alignItems': 'center',
    'fontSize': [{ 'unit': 'px', 'value': NaN }],
    'color': 'white'
  },
  'App-link': {
    'color': '#61dafb'
  },
  'Input-text': {
    'padding': [{ 'unit': 'px', 'value': 10 }, { 'unit': 'px', 'value': 10 }, { 'unit': 'px', 'value': 10 }, { 'unit': 'px', 'value': 10 }],
    'width': [{ 'unit': 'px', 'value': 500 }],
    'margin': [{ 'unit': 'px', 'value': 10 }, { 'unit': 'px', 'value': 10 }, { 'unit': 'px', 'value': 10 }, { 'unit': 'px', 'value': 10 }],
    'alignSelf': 'center',
    'textAlign': 'center',
    'backgroundColor': 'transparent',
    'color': 'white',
    'border': [{ 'unit': 'string', 'value': 'none' }],
    'fontSize': [{ 'unit': 'px', 'value': NaN }]
  },
  'cards': {
    'padding': [{ 'unit': 'px', 'value': 5 }, { 'unit': 'px', 'value': 0 }, { 'unit': 'px', 'value': 0 }, { 'unit': 'px', 'value': 0 }],
    'width': [{ 'unit': '%H', 'value': 1 }],
    'textAlign': 'center'
  },
  'cards__card': {
    'display': 'inline-block',
    'float': 'none',
    'height': [{ 'unit': 'px', 'value': 180 }],
    'width': [{ 'unit': 'px', 'value': 100 }],
    'fontSize': [{ 'unit': '%V', 'value': 0.9 }],
    'color': 'black',
    'margin': [{ 'unit': 'px', 'value': 5 }, { 'unit': '%H', 'value': 0.01 }, { 'unit': 'px', 'value': 0 }, { 'unit': 'px', 'value': 0 }],
    'lineHeight': [{ 'unit': 'px', 'value': 1.4 }],
    'paddingLeft': [{ 'unit': 'px', 'value': 0 }]
  },
  'cards__card li': {
    'display': 'inline',
    'textAlign': 'center'
  },
  'centerDiv': {
    'width': [{ 'unit': '%H', 'value': 1 }],
    'textAlign': 'center'
  },
  'card-front': {
    'height': [{ 'unit': 'px', 'value': 400 }],
    'width': [{ 'unit': 'px', 'value': 260 }],
    'fontSize': [{ 'unit': 'px', 'value': 171 }],
    'transform': 'translate(-50%, -50%)',
    'left': [{ 'unit': '%H', 'value': 0.5 }],
    'top': [{ 'unit': '%V', 'value': 0.5 }],
    'position': 'absolute'
  }
});
